import React, { Component } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

import logo from "../images/logo.svg";

export default class HomePage extends Component {
  render() {
    return (
      // <div>
      //   <Header />
      //   <img src={logo} className="App-logo" alt="logo" />
      //   <Footer />
      // </div>
      <div>
        <Header />
        <div id="carouselExampleIndicators" class="carousel slide" data-ride="carousel">
        <ol class="carousel-indicators">
            <li data-target="#carouselExampleIndicators" data-slide-to="0" class="active"></li>
            <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
            <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
        </ol>
        <div class="carousel-inner">
            <div class="carousel-item active">
                <img class="d-block w-100" src={logo} alt="First slide" />
            </div>
            <div class="carousel-item">
                <img class="d-block w-100" src={logo} alt="Second slide" />
            </div>
            <div class="carousel-item">
                <img class="d-block w-100" src={logo} alt="Third slide" />
            </div>
        </div>
            <a class="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev"></a>
            <a class="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next"></a>
    </div>
        <Footer />
      </div>
    );
  }
}
